import React from "react";
import { Link } from 'react-router-dom';

function About(props) {
    return(
        <>
        <div className="HeadOne">
          <h1>{props.head}</h1>
          <p>{props.para}</p>
          <button className="yipe"><Link to="/shop"><font color="black">Shop</font></Link></button><p >Up For Some Shopping?</p>
        </div>  
        </>
    )
}

export default About;
